INSERT [dbo].[Articles] ([ArticleId], [Title], [Summary], [Content], [Author], [IsUnlisted], [DateCreated], [LastUpdated]) VALUES (1, N'Creating a Doctrine Ships Contract', N'A guide to creating a valid contract that will be listed on the Doctrine Ships website.', N'<p>The following instructions are for registered sales agents only. Without a valid API key, the service cannot pull your contracts.</p><p><span style="text-decoration: underline;">1/4 Availability</span></p> <ul> <li>Select ''Item Exchange'' as the contract type.</li> <li>Select either ''My Corporation'' or ''My Alliance'' as the contract availability. Ensure that your corporation or alliance is listed as a customer on the main Doctrine Ships customer selection page and that the character you are creating the contract with is a member of that corporation or alliance.</li> <li>Click ''Next''.</li> </ul> <div><img style="display: block; margin-left: auto; margin-right: auto;" src="http://i.imgur.com/WRneCNI.png" alt="" width="632" height="627" /></div> <p><span style="text-decoration: underline;">2/4 Ship Selection</span></p> <ul> <li>Select the ship that you want to place on contract. The ship should be an official alliance or corporation doctrine ship fit and be listed on the ship fit list. It should contain <u>exactly</u> the correct number of modules, drones, ammo, nanite repair paste and scripts.</li> <li>The ship should be named with the ShipFitId such as ''DS9'', where DS stands for Doctrine Ships and 9 is the Id number.</li> <li>Click ''Next''.</li> </ul> <div><img style="display: block; margin-left: auto; margin-right: auto;" src="http://i.imgur.com/mvtOCys.png" alt="" width="624" height="624" /></div> <p><span style="text-decoration: underline;">3/4 Contract Price &amp; Description</span></p> <ul> <li>Enter the contract price into the ''I will receive'' box. The Doctrine Ships fit details tool may be used to calculate the correct profit percentages.</li> <li>Select an expiration of ''2 Weeks'' from the drop-down box.</li> <li>Enter the ShipFitId into the ''Description'' box. This is the link between the in-game contract and the correct fit information on the Doctrine Ships website. A ShipFitId should follow the formatting convention of ''DS&lt;ID&gt;'', where DS stands for Doctrine Ships and &lt;ID&gt; is the Id number listed in the Doctrine Ships fit list.</li> </ul> <div><img style="display: block; margin-left: auto; margin-right: auto;" src="http://i.imgur.com/UJcmRph.png" alt="" width="628" height="623" /></div> <p><span style="text-decoration: underline;">4/4 Confirmation</span></p> <ul> <li>Carefully check all of the details.</li> <li>''Availability'' should be Private and for your Corporation or Alliance.</li> <li>''Description'' should start with DS&lt;ID&gt;. This is very important.</li> <li>''I will receive'' should be the correct ''Contract Receive'' value from the Doctrine Ships fit details tool.</li> <li>Click ''Finish'' to list the contract. The Doctrine Ships website should automatically update within 20-30 minutes.</li><li>As long as the contract items match the ship fit exactly, the contract will be marked as valid and set green.</li></ul> <div><img style="display: block; margin-left: auto; margin-right: auto;" src="http://i.imgur.com/1PHpbt1.png" alt="" width="629" height="620" /></div>', N'Lupercus Anninen', 0, CAST(0x0000A2C6012F3900 AS DateTime), CAST(0x0000A2C6012F3900 AS DateTime))
INSERT [dbo].[Articles] ([ArticleId], [Title], [Summary], [Content], [Author], [IsUnlisted], [DateCreated], [LastUpdated]) VALUES (5, N'Generating an API Key', N'A guide to generating an Eve API Key for use with Doctrine Ships.', N'<p>Go to the EVE Online website <a href="https://community.eveonline.com/support/api-key/CreatePredefined?accessMask=67108864" />https://community.eveonline.com/support/api-key/CreatePredefined?accessMask=67108864</a> and generate an API key with the options shown below. Ensure that the ''No Expiry'' option is selected and that your contracting character is chosen.</p><p>Enter a name for the API key (For example: ''Doctrine Ships Contracts'') and click ''Submit''.</p><p>Send an in-game mail to ''Lupercus Anninen'' with your Key ID and Verification Code.</p><br /><img style="display: block; margin-left: auto; margin-right: auto;" src="http://i.imgur.com/mHJlVHO.png" alt="" width="700" height="957"/>', N'Lupercus Anninen', 0, CAST(0x0000A2C6013AC220 AS DateTime), CAST(0x0000A2C6013AC220 AS DateTime))
SET IDENTITY_INSERT [dbo].[Articles] OFF

