INSERT [dbo].[ShipFits] ([ShipFitId], [AccountId], [HullId], [ThumbnailUrl], [RenderImageUrl], [Hull], [Name], [Role], [ContractsAvailable], [FitPackagedVolume], [BuyPrice], [SellPrice], [ShippingCost], [ContractReward], [BuyOrderProfit], [SellOrderProfit], [FittingString], [LastPriceRefresh], [IsMonitored], [FittingHash], [Notes]) VALUES (1059, 0, 609, N'https://image.eveonline.com/InventoryType/609_64.png', N'https://image.eveonline.com/Render/609_256.png', N'Maulus', N'Non-Doctrine - Newbro Multi-Role Armour Maulus', N'EWAR', 0, 2606, 1131698.4451000001, 1401935.3599999999, 299690, 1851818.896, 720120.45089999982, 449883.53600000008, N'609:179;400:185;400:486;2:609;1:2046;1:2486;4:5299;2:5405;1:5971;1:11349;1:11563;1:23711;2:29013;2:29015;2::', CAST(0x0000A2F6016869CF AS DateTime), 0, N'521FA4F1B35B8AAC8F6191CA34CD966242522FE2', N'-Do not tackle and damp you will run out of capacitor. They have auto-cannon as weapons because they use no capacitor.

-These are not fast tackle but have some tank. If you are skilled for the light armor maintenance bots assign them to logi if the the FC calls for drones. 

-If your drones have the range in the engagement assign warriors to the FC or keep them for defense.

-If you are dampening targets keep aligned to a bookmark and warp out when yellow boxed and come back afterwards.

-The best way of doing this is to make a bookmark whilst you are warping in close to the combat area so you are not off field for too long.')
